columns_description:
CDBG allows for funding 16 different types of project: 
1.	Community Planning;
2.	Comprehensive Project (mix of two or more of the other categories; HCR has had none since PY 2008);
3.	Economic Development;
4.	Home Ownership;
5.	Housing Rehab;
6.	Imminent Threat;
7.	Innovative Projects (funded only for PY 2010);
8.	Mobile Home;
9.	New Construction (current CDBG guidelines do not allow for new construction; last HCR project was in PY 2006);
10.	Public Facilities;
11.	Public Service (as of PY 2001, HCR does not fund public service projects though eligible under the CDBG guidelines);
12.	Public Sewer;
13.	Public Water;
14.	Small Business;
15.	Technical Assistance;
16.	Wells & Septics.
